      >
        <li data-lake-id="c5bd9ff6ed453bfa65ea365fd5a120d7">
          Method:
          <strong>GET</strong>
        </li>
        <li data-lake-id="7608bce01bfce6e00e26bbea027a036d">
          URL:
          <code
            style="font-family: monospace; font-size: inherit; background-color: rgba(0, 0, 0, 0.06); padding: 0px 2px; border: 1px solid rgba(0, 0, 0, 0.08); border-radius: 2px; line-height: inherit; overflow-wrap: break-word; text-indent: 0px;"
          >/api/v1/userInfo?productKey=bnkvnp455k3dh11hn1ng&amp;deviceKey=bnkvqa455k3dh11hn1o0</code>
